      <div className="ProfileMatchELO">ELO %d</div>
      <div className="ProfileMatchHistoryBG">
        <div className="ProfileMatchHistoryList">
          <div>history1</div>
          <div>history2</div>
        </div>
      </div>
    </div>
  );
}
